import React from 'react'
import Form from 'react-bootstrap/Form'

export default function inputForm({ title }) {
	const onInput = (e) => console.log('event', e.target.value)

	return (
		<Form>
			<Form.Group>
				<Form.Label>Title</Form.Label>
				<Form.Control className="mb-4" size="lg" onChange={onInput} />
			</Form.Group>
		</Form>
	)
}
